CREATE DEFINER=`root`@`localhost` EVENT `update_all_barangay_counts` ON SCHEDULE EVERY 1 DAY STARTS '2024-08-23 23:43:31' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    UPDATE barangays b
    JOIN (
        SELECT barangayID, 
               SUM(CASE WHEN status = 1 THEN 1 ELSE 0 END) as claimed,
               SUM(CASE WHEN status = 2 THEN 1 ELSE 0 END) as unclaimed,
               SUM(CASE WHEN status = 3 THEN 1 ELSE 0 END) as disqualified,
               SUM(CASE WHEN status = 4 THEN 1 ELSE 0 END) as double_entry
        FROM beneficiaries
        GROUP BY barangayID
    ) counts ON b.barangayID = counts.barangayID
    SET b.claimed = counts.claimed,
        b.unclaimed = counts.unclaimed,
        b.disqualified = counts.disqualified,
        b.double_entry = counts.double_entry,
        b.updated_at = NOW();
END$$

CREATE DEFINER=`root`@`localhost` EVENT `update_all_masterlists` ON SCHEDULE EVERY 1 DAY STARTS '2024-09-11 15:46:53' ON COMPLETION NOT PRESERVE ENABLE DO BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE curr_masterlistID INT;
    DECLARE cur CURSOR FOR SELECT masterlistID FROM masterlists;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN cur;

    read_loop: LOOP
        FETCH cur INTO curr_masterlistID;
        IF done THEN
            LEAVE read_loop;
        END IF;
        CALL UpdateMasterlistTotals(curr_masterlistID);
    END LOOP;

    CLOSE cur;
END$$

